    false,nt"url": null,nt"notes": "Back Bay National Wildlife Refuge was established
    in 1938 to provide habitat and protection for migratory birds. Management objectives
    have since been expanded to provide for a broader spectrum of wildlife, with special
    emphasis on waterfowl, shorebirds and threatened and endangered species; and to
    provide the visiting public with opportunities for wildlife oriented recreation
    and environmental education to the extent compatible with resource needs.  The potential
    for diseases of waterfowl and other migratory birds is high for Back Bay. Contributing
    factors including large migratory concentrations and shallow water depths dictate
    a need for disease contingency planning. Planning objectives include: 1) outlining
    procedures for early detection and identification of diseases, 2) outlining procedures
    to minimize mortality from outbreaks, and 3) management of habitat and populations
    to decrease the likelihood of outbreak.",nt"license_title": "License Not Specified",nt"extras":
